public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + ((appId == null) ? 0 : appId.hashCode());
  result =
      prime * result
          + ((shortUserName == null) ? 0 : shortUserName.hashCode());
  return result;
}
